<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>The Colony: Decoder</title>

<style type="text/css">
	body {
		color: white;
		background-color: black;	
		margin: 0;
	}
	.outer {
		max-width: 1024px;
		margin: auto;
	}
	.container {
		position: relative;
	}
	.layer {
		position: absolute;
		width: 100%;
		top: 0;
		left: 0;
	}
	.layer.back {
		display: none;
	}
	.container.back .layer.back {
		display: block;
	}
	.container.back .layer.front {
		display: none;
	}
	.btnFlip {
		position: absolute;
		left: 0;
		top: 0;
		width: 150px;
		height: 45px;
		font-size: 21px;
		transform-origin: left top;
	}
	.slider {		
		position: absolute;
		-webkit-appearance: none;
		width: 319px;
		height: 21px;
		border-radius: 5px;  
		background: #d3d3d3;
		outline: none;
		opacity: 0.7;
		-webkit-transition: .2s;
		transition: opacity .2s;
		transform: rotate(90deg);	
	}
	.slider:hover {
		opacity: 1;
	}
	.slider::-webkit-slider-thumb {
		-webkit-appearance: none;
		appearance: none;
		width: 35px;
		height: 35px;
		border-radius: 50%; 
		background: #0475aa;
		cursor: pointer;
	}
	.slider::-moz-range-thumb {
		width: 35px;
		height: 35px;
		border-radius: 50%;
		background: #0475aa;
		cursor: pointer;
	}
</style>

		<input type="range" min="0" max="7" value="0" class="slider">
		<button class="btnFlip">Flip Decoder</button>
	</div>
</div>

<script>
	var sliderOffsetLeft = -161;
	var sliderOffsetTop = -17;
	var sliderPosLeft = 100;
	var sliderPosTop = 883;
	var codeHeight = 49.5;
	var layerBottom = document.querySelector('.layer.front.bottom');
	var slider = document.querySelector('.slider');
	var btnFlip = document.querySelector('.btnFlip');
	var container = document.querySelector('.container');
	positionControls();
	function positionControls() {
		var scale = layerBottom.width / layerBottom.naturalWidth ;		
		var left = sliderOffsetLeft + sliderPosLeft * scale;
		var top =  sliderOffsetTop + sliderPosTop * scale;
		slider.style.left = left + 'px';
		slider.style.top = top + 'px';
		slider.style.transform = 'scale(' + scale + ') rotate(90deg)';
		
		left = 90 * scale;
		top = 1050 * scale;
		btnFlip.style.left = left + 'px';
		btnFlip.style.top = top + 'px';
		btnFlip.style.transform = 'scale(' + scale + ')';
	}	
	function adjustSlider() {
		var scale = layerBottom.width / layerBottom.naturalWidth;
		var top = -codeHeight * scale * slider.value;

		layerBottom.style.top = top + 'px';
	}
	function flipDecoder() {
		if (container.classList.contains('back')) {
			container.classList.remove('back');
			layerBottom = document.querySelector('.layer.front.bottom');
		} else {
			container.classList.add('back');
			layerBottom = document.querySelector('.layer.back.bottom');
		}
		adjustSlider();
	};
	slider.addEventListener("input", function() {
		adjustSlider();
	});
	window.addEventListener("resize", function() {
		positionControls();
		adjustSlider();
	});
	btnFlip.addEventListener("click", function() {
		flipDecoder();
	});
</script>
